import React from 'react';
import './UserHelpCenter.css';
import { useState } from 'react';
import UserHelpCard from './UserHelpCard';

function UserHelpCenter() {

  const [searchQuery, setSearchQuery] = useState('');

  const handleSearchChange = (e) => {
    setSearchQuery(e.target.value); 
  };
  

  const helpCards = [
    { id: 1, icon: <span><i className="fa-solid fa-palette" style={{ color: '#d67a3d' }} /></span>, title: 'Announcement', description: "We've got our ear to the ground. Here's what you need to know" },
    { id: 2, title: 'Hi', description: 'This is a test description' },
    { id: 3, title: 'Help', description: 'Another description' },
    { id: 4, title: 'Support', description: 'We are here to help' },
  ];

  return (
    <div>
      <h1 className='ad-user-pages-title'>Help Center</h1>
      <div className='ad-user-help-center-wrap'>
        <div className='ad-help-center-header'>
        <h2>How can we help?</h2>
        <input
        type="text"
        placeholder="Search..."
        value={searchQuery}
        onChange={handleSearchChange}
        className="ad-user-help-search"
      />
        </div>
        <div className='ad-user-help-card-container'>
          <UserHelpCard
          key={card.id}
          icon={card.icon}
          title={card.title}
          description={card.description}
          />
        </div>
      </div>
    </div>
  )
}

export default UserHelpCenter
